'            raise_application_error(-20005, ''Erro ao renderizar plugin! Selecione SOMENTE UM ITEM para ser afetado!'');',
'        end if;',
'',
'        apex_json.initialize_clob_output;',
'            apex_json.open_object;',
'                apex_json.write(''itemID'', l_id_item);',
'                apex_json.write(''buttonsID'', l_id_buttons);',
'                apex_json.write(''itemFormat'', l_format_default);',
'            apex_json.close_object;',
'        l_result.javascript_function := ''function (){validate('' || apex_json.get_clob_output || '');}'';',
